export interface Company {
  id: number | undefined;
  name: string;
  email: string;
  password: number;
  coupons: Coupon[];
}

export interface Coupon {
  id: number | undefined;
  category: Category | undefined;
  startDate: string | undefined;
  endDate: string | undefined;
  amount: number | undefined;
  price: number | undefined;
  image: string | undefined;
}

export enum Category {
  FOOD = "FOOD",
  ELECTRICITY = "ELECTRICITY",
  RESTAURANT = "RESTAURANT",
  VACATION = "VACATION",
}
export const CategoryImages ={
  FOOD: 'C:\Users\nirg\Desktop\spring\cuoponProject\cuoponProject\client\src\couponsCategoryPic\FOOD.png',
  RESTAURANT:'C:\Users\nirg\Desktop\spring\cuoponProject\cuoponProject\client\src\couponsCategoryPic\RESTAURANT.png',
  ELECTRONICS: 'C:\Users\nirg\Desktop\spring\cuoponProject\cuoponProject\client\src\couponsCategoryPic\ELECTRICITY.png',
  VACATION:'C:\Users\nirg\Desktop\spring\cuoponProject\cuoponProject\client\src\couponsCategoryPic\VACATION.png'
};

export const getImagePath = (category: Category): string => {
  switch(category) {
    case Category.FOOD:
      return CategoryImages.FOOD;
    case Category.RESTAURANT:
      return CategoryImages.RESTAURANT;
    case Category.ELECTRICITY:
      return CategoryImages.ELECTRONICS;
    case Category.VACATION:
      return CategoryImages.VACATION;
    default:
      return '';
  }
}


export interface Customer {
  id: number | undefined;
  firstName: string | undefined;
  lastName: string | undefined;
  email: string;
  password: number;
  coupons: Coupon[];
}
export enum UserType {
  ADMINISTRATOR = "ADMINISTRATOR",
  ELECTRICITY = "COMPANY",
  RESTAURANT = "CUSTOMER",
}
